import React from 'react';
import { Router, Route } from "react-router-dom";

// 기존 컴포넌트
import Main from './pages/main';

// 새로운 App 구성
const App = () => {
  return (
    <Router>
      <Route path="" element={<Main />}></Route>
    </Router>
  );
};

export default App;
